  false,\n\t\"url\": null,\n\t\"notes\": \"The USGS Transportation service from The
  National Map (TNM) is based on TIGER/Line data provided through U.S. Census Bureau
  and road data from U.S. Forest Service. Some of the TIGER/Line data includes limited
  corrections done by USGS. Transportation data consists of roads, railroads, trails,
  airports, and other features associated with the transport of people or commerce.
  The data include the name or route designator, classification, and location. Transportation
  data support general mapping and geographic information system technology analysis
  for applications such as traffic safety, congestion mitigation, disaster planning,
  and emergency response. The National Map transportation data is commonly combined
  with other data themes, such as boundaries, elevation, hydrography, and structures,
  to produce general reference base maps. The National Map Download Client allows
  free downloads of public domain transportation data in either Esri File Geodatabase
  or Shapefile formats. For additional information on the transportation data model,
  go to http://nationalmap.gov/transport.html.\",\n\t\"license_title\": null,\n\t\"extras\":
